import React, {Component} from 'react';
import {Redirect} from "react-router-dom";

class Home extends Component {
    export
    default
    Home;

    render() {

        if (sessionStorage.getItem("userName") == null) {

            return <Redirect to="/login"/>

        } else {

            return (

                <div>
                    <h1>Home</h1>
                </div>
            );

        }


    }
}
